import React from 'react'
import background from './templo.jpg';

function Home(){
    return(
        <div className='home'>
            <h1>Home</h1>
            <div style={{ backgroundImage: `url(${background})` }}>
      
      </div>
            
        </div>
        
        
    )
}

export default Home;
